import React, { Component } from 'react';
import './gradeEntry.css';

class TableItemHead extends Component {
    render() {

        const cellStyle = {
            width: "120px",
            textAlign: "center"
        }


        return (
        <th className="p-0 px" style={cellStyle} scope="col">
            <div className="col">
            <small>({this.props.points})</small>
                </div>
            
            {this.props.title}  </th>
        );
    }
}

export default TableItemHead;
